import React from 'react';
import { ResponsiveContainer, LineChart, Line, Legend, XAxis, YAxis, CartesianGrid, Tol } from 'recharts';

const pdata = [
    {
        name: 'January',
        fValue: 3,
        sValue: 1
    },
    {
        name: 'February',
        fValue: 3,
        sValue: 1.5
    },
    {
        name: 'March',
        fValue: 4,
        sValue: 3
    },
    {
        name: 'May',
        fValue: 2,
        sValue: 1
    },
    {
        name: 'June',
        fValue: 4,
        sValue: 2.5
    },
    {
        name: 'July',
        fValue: 5,
        sValue: 2
    }
    
];
const ChartMonthlySales = () => {
    return (
        <>
          <ResponsiveContainer width="100%" aspect={1}>
            <LineChart data={pdata} margin={{right:10,top:10, left:-40}} >
            <Legend dataKey="sValue"/>
            <CartesianGrid strokeDasharray="3 3"/>
            <XAxis dataKey="name" tickCount={1} interval={'preserveStartEnd'}/>
            <YAxis tickCount={5}/>
             <Line dataKey="fValue" stroke="#30475e" activeDot={{r:5}} />
             
            </LineChart>
          </ResponsiveContainer>
        </>
    )
}

export default ChartMonthlySales;
